// --- src/component/Page/Header.js ---
import React from 'react';
import { Box, Button, Typography, Grid, Card, Container, Paper } from '@mui/material'; // Added Container, Paper
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext'; // <<< Import useAuth

// Import Icons
import AccountBalanceWalletIcon from '@mui/icons-material/AccountBalanceWallet';
import SwapHorizIcon from '@mui/icons-material/SwapHoriz';
import DownloadIcon from '@mui/icons-material/Download';
import LogoutIcon from '@mui/icons-material/Logout';

// Optional: Import the new downloader component if created separately
// import TransactionHistoryDownloader from '../Customer/TransactionHistoryDownloader';

const Header = () => { // Removed setIsLoggedIn prop, use context instead
    const navigate = useNavigate();
    const { logout, authState } = useAuth(); // <<< Get logout and authState from context

    const handleLogout = () => {
        logout(); // Use context logout function
        navigate("/login"); // Redirect to login page
    };

    // --- NEW --- Function to handle download request (Placeholder)
    const handleDownloadHistory = async () => {
        // TODO: Implement Backend Call for Transaction History Download
        // 1. Need a backend endpoint (e.g., GET /transactions/download)
        // 2. Backend retrieves transactions for the authenticated user (using customerId from security context).
        // 3. Backend generates a file (PDF, CSV).
        // 4. Backend sends the file back with appropriate headers (Content-Disposition: attachment; filename="...")
        // 5. Frontend axios call needs responseType: 'blob'
        // 6. Frontend creates a URL for the blob and triggers download.

        alert('Download Transaction History - Backend endpoint not implemented yet.');

        /* Example Axios call structure (needs backend implementation):
        try {
            const response = await axios.get('/api/transactions/download', { // Adjust endpoint
                responseType: 'blob', // Important for file download
                withCredentials: true // If using cookies
                // headers: { 'Authorization': `Bearer ${token}` } // If using JWT
            });

            // Create a URL for the blob object
            const url = window.URL.createObjectURL(new Blob([response.data]));
            const link = document.createElement('a');
            link.href = url;

            // Extract filename from Content-Disposition header if available
            const contentDisposition = response.headers['content-disposition'];
            let filename = 'transaction-history.pdf'; // Default filename
            if (contentDisposition) {
                const filenameMatch = contentDisposition.match(/filename="?(.+)"?/i);
                if (filenameMatch.length === 2)
                    filename = filenameMatch[1];
            }

            link.setAttribute('download', filename);
            document.body.appendChild(link);
            link.click();

            // Clean up
            link.parentNode.removeChild(link);
            window.URL.revokeObjectURL(url);

        } catch (error) {
            console.error("Error downloading transaction history:", error);
            alert('Failed to download transaction history.');
        }
        */
    };


    return (
        <Container maxWidth="md" sx={{ mt: 4, mb: 4 }}>
             <Paper elevation={3} sx={{ p: 3, mb: 4 }}>
                 <Typography variant="h4" component="h1" gutterBottom align="center">
                    My Account Dashboard
                 </Typography>
                 <Typography variant="body1" paragraph align="center">
                     Welcome, Customer {authState.customerId}! Manage your account below.
                 </Typography>
             </Paper>

            <Grid container spacing={3} justifyContent="center">

                {/* Card 1: Check Balance */}
                <Grid item xs={12} sm={6} md={4}>
                    <Card sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', p: 3, height: '100%', '&:hover': { boxShadow: 6 } }}>
                        <AccountBalanceWalletIcon color="primary" sx={{ fontSize: 40, mb: 1 }} />
                        <Typography variant="h6" gutterBottom>Check Balance</Typography>
                        <Button component={Link} to="/check-balance" variant="contained">
                            Check Now
                        </Button>
                    </Card>
                </Grid>

                {/* Card 2: Transfer Money */}
                <Grid item xs={12} sm={6} md={4}>
                     <Card sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', p: 3, height: '100%', '&:hover': { boxShadow: 6 } }}>
                        <SwapHorizIcon color="secondary" sx={{ fontSize: 40, mb: 1 }} />
                        <Typography variant="h6" gutterBottom>Transfer Money</Typography>
                        <Button component={Link} to="/transfer" variant="contained" color="secondary">
                            Transfer
                        </Button>
                    </Card>
                </Grid>

                 {/* Card 3: Download History */}
                 <Grid item xs={12} sm={6} md={4}>
                     <Card sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', p: 3, height: '100%', '&:hover': { boxShadow: 6 } }}>
                        <DownloadIcon sx={{ fontSize: 40, mb: 1, color: 'success.main' }} />
                        <Typography variant="h6" gutterBottom>Transactions</Typography>
                        <Button onClick={handleDownloadHistory} variant="contained" color="success">
                            Download History
                        </Button>
                         {/* Optional: Link to a page showing history if not direct download
                         <Button component={Link} to="/transaction-history" variant="contained" color="success">
                             View History
                         </Button>
                         */}
                    </Card>
                </Grid>

                 {/* Remove Deposit Card */}
                 {/* <Grid item xs={12} sm={6} md={4}> ... </Grid> */}

                 {/* Remove Withdraw Card */}
                 {/* <Grid item xs={12} sm={6} md={4}> ... </Grid> */}

            </Grid>
        </Container>
    );
};

export default Header;
